[
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "The first thought that comes to mind when velour tracksuits are involved are Paris Hilton, Britney Spears and J.Lo in all of their early '00s glory. "
  },
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "However, if you thought velour was one fabric you'd only pull out for a throwback party, we're here to inform you that it's slowly making its return."
  },
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "***RELATED: ***[HOW TO MAKE 2017 YOUR MOST STYLISH YEAR YET](http://www.elle.com.au/fashion/trends/2017/1/how-to-make-this-your-most-stylish-year/)"
  },
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "First, Juicy Couture (of course) teamed up with Vetements to debut the return of the tracksuits at Paris Couture Fashion Week last June, prompting a lot of confusion, but now, a good few months down the track and it seems the A-list just can't get enough. "
  },
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "Proof of the impending street style trend here."
  }
]
